import React from 'react';
import './index.css';

export const TopBar = (props) => {
    const { nextPressed } = props;
    return (
        <div className="topBarContainer">
            <button onClick={nextPressed} className="skipButton">Skip</button>
            <button onClick={nextPressed} className="nextButton">Next</button>
        </div>
    )
}
